n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\n# from deisa import Deisa\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    # Construct a lazy task graph\n    cpt = Derivee(gt, 1).mean()\n\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_ANALYTICS_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1526","type":"AdaptiveTicker"},{"attributes":{},"id":"1004","type":"DataRange1d"},{"attributes":{"tools":[{"id":"1211"}]},"id":"1200","type":"Toolbar"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1060","type":"BoxAnnotation"},{"attributes":{"coordinates":null,"formatter":{"id":"1429"},"group":null,"major_label_policy":{"id":"1430"},"ticker":{"id":"1017"},"visible":false},"id":"1016","type":"LinearAxis"},{"attributes":{},"id":"1432","type":"BasicTickFormatter"},{"attributes":{},"id":"1164","type":"CategoricalTicker"},{"attributes":{"line_alpha":0.1,"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1309","type":"Line"},{"attributes":{"tools":[{"id":"1386"},{"id":"1387"},{"id":"1388"}]},"id":"1389","type":"Toolbar"},{"attributes":{},"id":"1198","type":"CategoricalTicker"},{"attributes":{"below":[{"id":"1378"}],"center":[{"id":"1381"},{"id":"1385"}],"height":150,"left":[{"id":"1382"}],"renderers":[{"id":"1397"}],"sizing_mode":"stretch_both","title":{"id":"1369"},"toolbar":{"id":"1389"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1374"},"y_range":{"id":"1372"},"y_scale":{"id":"1376"}},"id":"1368","subtype":"Figure","type":"Plot"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1096","type":"BoxAnnotation"},{"attributes":{"tools":[{"id":"1179"}]},"id":"1169","type":"Toolbar"},{"attributes":{"below":[{"id":"1048"}],"ce
